function addToCart(n,t){var i=$("#antiForgeryForm input[name=__RequestVerificationToken]").val(),r={productId:n,quantity:t};$.ajax({type:"POST",url:"/shoppingcart/addcartitem",data:JSON.stringify(r),dataType:"html",contentType:"application/json; charset=utf-8",headers:{RequestVerificationToken:i},success:function(n){var t=new bootstrap.Modal($(n));t.show()}})}